import React, {useState} from 'react';

const App = () =>{
const [input, setinput] = useState(6);
    return(
        <>
        <progress value="10" style={{height:'50px', width:'300px'}} max="100"> 10%</progress>
        <br/>
        <input type="text" value={input} onChange={(e) =>{
            setinput(e.target.value);
        }}/>
          </>
    )
}
export default App;
